    font-weight: 600;
    margin: 0;
`
export const NavBarContainer = styled.div`
    display: flex;
    justify-content: space-between;
    width: 100%;
    background-color: rgba( 74,87,96, 0.5);
    padding: 20px 10px;
`;
export const NavigationContainer = styled.div`
    display: flex;
    flex-direction: row;
